import React from "react";

import "./Feedback.css";

function Feedback() {
  return (
    <div className="feedback">
      <h3 className="empty-h3">Hi! I'm still building this app.</h3> Please
      leave your feedback to help it get better:
    </div>
  );
}

export default Feedback;
